//app.js
App({
  onLaunch: function() {
    // 展示本地存储能力
    var logs = wx.getStorageSync('logs') || []
    logs.unshift(Date.now())
    wx.setStorageSync('logs', logs)

    // 登录
    wx.login({
        success: res => {
          // 发送 res.code 到后台换取 openId, sessionKey, unionId
        }
      })
      // 获取用户信息
    wx.getSetting({
      success: res => {
        if (res.authSetting['scope.userInfo']) {
          // 已经授权，可以直接调用 getUserInfo 获取头像昵称，不会弹框
          wx.getUserInfo({
            success: res => {
              // 可以将 res 发送给后台解码出 unionId
              this.globalData.userInfo = res.userInfo

              // 由于 getUserInfo 是网络请求，可能会在 Page.onLoad 之后才返回
              // 所以此处加入 callback 以防止这种情况
              if (this.userInfoReadyCallback) {
                this.userInfoReadyCallback(res)
              }
            }
          })
        }
      }
    })
  },
  globalData: {
    userInfo: null,
    host: '127.0.0.1:11111',
    // host:'192.168.5.133:11111',
    // host:'192.168.10.107:11111',
    icon: {
      earIcon: 'data:image/svg+xml;base64,',
      arrowRight: 'data:image/svg+xml;base64,',
      loading: 'data:image/gif;base64,',
      logoFooter: 'data:image/svg+xml;base64,',
      logoHeader: 'data:image/svg+xml;base64,',
      logoPlayer: 'data:image/svg+xml;base64,',
    },
    imgExt: {
      index: '.webp?imageView&thumbnail=246x0&quality=75&tostatic=0&type=webp',
      list: '.webp?imageView&thumbnail=100x0&quality=75&tostatic=0&type=webp',
      playerAlbum: '.webp?imageView&thumbnail=721y721&quality=75&tostatic=0&type=webp',
      avatar: '.webp?imageView&thumbnail=60x0&quality=75&tostatic=0&type=webp',
      simiSong: '.webp?imageView&thumbnail=80x0&quality=75&tostatic=0&type=webp',
    },
    imgFormat(url, name) {
      return url.replace(/\.[a-z]+$/, this.imgExt[name]);
    }
  }
})